import React from "react";
import styled from "styled-components";
import { Button, ScrollView } from "react-native";
import { Icon } from "react-native-elements";
import { Ionicons } from "@expo/vector-icons";
import { FontAwesome5 } from "@expo/vector-icons";
const Card = props => (
  <Container>
    <DayContainer>
      <Days>{props.hour}</Days>
    </DayContainer>

    <Content>
      <Row>
        <Div>
          <Title>{props.hour}</Title>
          <RoundContainer>
            <Ionicons
              name="ios-water"
              style={{ textAlign: "center" }}
              size={28}
              color="blue"
            />
            <NumberText>75Â°</NumberText>
          </RoundContainer>
        </Div>
      </Row>
    </Content>
  </Container>
);

export default Card;

//Whole Card
const Container = styled.View`
  background: transparent;
  width: 99%;
  margin: 2px 2px;

  top: 65%;
  box-shadow: 0 5px 15px rgba(0, 0, 0, 0.15);
`;

const Div = styled.View`
  flex-direction: column;
  width: 100%;
`;
const DayContainer = styled.View`
  flex-direction: column;
  display: flex;
`;

const Content = styled.View`
  flex-direction: column;
  display: flex;
  height: 65%;
`;

//LakeName
const Title = styled.Text`
  color: white;
  font-size: 17px;
  text-align: center;
`;
const Days = styled.Text`
  color: white;
  font-size: 20px;
  text-align: center;
  font-weight: bold;
`;
const NumberText = styled.Text`
  color: white;
  font-size: 18px;
  padding-top: 20%;
  text-align: center;
`;

const Distance = styled.Text`
  color: white;
  font-size: 16px;
  padding-bottom: 8%;
  margin-left: 20px;
`;
//Container Information Start
const RoundContainer = styled.View`
  border-radius: 80px;
  border: 1px solid gray;
  margin-left: 5%;
`;

const Row = styled.View`
  flex: 1;
  display: flex;
  flex-direction: column;
`;
